import React, { useState, useEffect } from "react";
import axios from "axios";

const PlayerList = () => {
  const [players, setPlayers] = useState([]);
  const [filter, setFilter] = useState("");
  const [sortBy, setSortBy] = useState("number");

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/players")
      .then((response) => setPlayers(response.data))
      .catch((error) => console.error("Fehler beim Abrufen der Spieler:", error));
  }, []);

  const positionColors = {
    Torwart: "bg-green-500",
    Abwehr: "bg-blue-500",
    Mittelfeld: "bg-yellow-500",
    Sturm: "bg-red-500",
  };

  const sortedPlayers = [...players].sort((a, b) => {
    if (sortBy === "position") {
      const positionOrder = ["Torwart", "Abwehr", "Mittelfeld", "Sturm"];
      return positionOrder.indexOf(a.position) - positionOrder.indexOf(b.position);
    }
    return a[sortBy] - b[sortBy];
  });

  const filteredPlayers = sortedPlayers.filter((player) =>
    player.name.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div className="space-y-6">
      <div className="flex space-x-4 mb-4">
        <input
          type="text"
          placeholder="Spieler suchen..."
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
          className="p-2 border rounded-lg flex-1"
        />
        <select
          value={sortBy}
          onChange={(e) => setSortBy(e.target.value)}
          className="p-2 border rounded-lg"
        >
          <option value="number">Nach Nummer sortieren</option>
          <option value="position">Nach Position sortieren</option>
        </select>
      </div>
      <div className="overflow-x-auto">
        <table className="w-full bg-white dark:bg-gray-800 shadow-md rounded-lg">
          <thead className="bg-gray-200 dark:bg-gray-700">
            <tr>
              <th className="p-3 text-left">Nr.</th>
              <th className="p-3 text-left">Name</th>
              <th className="p-3 text-left">Position</th>
              <th className="p-3 text-left">Geburtsdatum</th>
              <th className="p-3 text-left">Alter</th>
              <th className="p-3 text-left">Nation</th>
              <th className="p-3 text-left">Vertrag</th>
              <th className="p-3 text-left">Wert</th>
            </tr>
          </thead>
          <tbody>
            {filteredPlayers.map((player) => (
              <tr
                key={player.id}
                className="border-b dark:border-gray-700 hover:bg-gray-50 dark:hover:bg-gray-600 transition"
              >
                <td className="p-3">{player.number}</td>
                <td className="p-3">{player.name}</td>
                <td className="p-3">
                  <span
                    className={`inline-block px-2 py-1 text-xs font-semibold text-white rounded-full ${positionColors[player.position]}`}
                  >
                    {player.position}
                  </span>
                </td>
                <td className="p-3">{player.birthdate || "-"}</td>
                <td className="p-3">{player.age || "-"}</td>
                <td className="p-3">{player.nation || "-"}</td>
                <td className="p-3">{player.contract || "-"}</td>
                <td className="p-3">{player.value || "-"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default PlayerList;
